import React, { useState } from 'react';
import { ThemeSwitch, Button, BreadCrumb, Input } from 'switch-themes';
import 'switch-themes/dist/cjs/styles/_main.scss';
import './App.css';

function App() {

  const [theme, setTheme] = useState('light');

  const handleUpdateBreadCrumb = (e: React.ChangeEvent<HTMLInputElement>) => {
  }

  return (
    <>
      <ThemeSwitch themeState={theme}>
        <Input type='text' placeHolder='display string' onChange={(e) => handleUpdateBreadCrumb(e)} />
        <Button className='hello' label={theme} handleClick={() => setTheme(theme === 'light' ? 'dark' : 'light')} />
        <BreadCrumb
          className='h'
          arr={[
            { display: 'profile', routeTo: '' },
            { display: 'profile/change', routeTo: '' },
          ]} />
      </ThemeSwitch>
    </>
  );
}

export default App;
